module.exports = async d => {
    const code = d.command.code 
    
    const r = code.split("$isManaged[").length - 1 
    
    const inside = code.split("$isManaged[")[r].split("]")[0] 
    
    const role = d.message.guild.roles.cache.get(inside) 
    
    if (!role) return d.error(`❌ Invalid role ID in \`$isManaged[${inside}]\``) 
    
    return {
        code: code.replaceLast(`$isManaged[${inside}]`, role.managed)
    }
}